import React, { Component } from 'react';

class Like extends Component {

    render() {
        let classes = "fa fa-heart"

        return ( 
            <React.Fragment>
                if(!this.props.like){
                    classes += "-o"
                }

                <i className={classes}></i>
            </React.Fragment>
         );
    }
}

export default Like;
